import React from "react";
import Link from "next/link";
import { Menu, Input, Button } from "antd";
const AppLayout = ({ children }) => {
  return (
    <div>
      <Menu mode="horizontal">
        <Menu.Item Key="home">
          <Link href="/">
            <a>노드버드</a>
          </Link>
        </Menu.Item>
        <Menu.Item Key="profile">
          <Link href="/profile">
            {" "}
            <a>프로필</a>
          </Link>
        </Menu.Item>
        <Menu.Item Key="mail">
          <Input.Search
            enterButton
            style={{ verticalAlign: "middle" }}
          ></Input.Search>
        </Menu.Item>
      </Menu>
      <Button>회원가입</Button>
      {children}
    </div>
  );
};
export default AppLayout;
